<tr><td width="90" bgcolor="#EEEEEE">商品説明</td><td bgcolor="#FFFFFF"><span class="style7">   
●焼けた砂浜やビーチに落ちている割れた貝殻やガラス、ゴツゴツした岩場などからお子様の大切な足を守ります。<br>●摩擦滑り止めソールで転倒の防止にも。<br>
※滑りにくいよう設計はされておりますが、プールサイドや濡れた岩場などの滑りやすい場所では転倒に十分ご注意ください。<br>
●アッパーには柔軟性と速乾性に優れたネオプレン素材とメッシュを使用。すぐに乾くのでムレにくく快適に過ごしていただけます。<br>
●かかとについたプルタブでお子様ご自身での履き替えがしやすくなっています。<br></span></td></tr>
<tr><td width="90" bgcolor="#EEEEEE">商品について</td><td bgcolor="#FFFFFF"><font color="#ff0000">※当社はiplay 正規販売店です。<br>
当店の商品はすべて正規ルートにての買い付けしております。<br>偽造品などの商品の販売は一切しておりませんので、ご安心してお買い物くださいませ。</font><br></tr></table> 
